import React from 'react'
import {
  HeaderButton,
  HeaderContainer,
  HeaderLink,
  SearchBar,
  TableLoader,
  FilterToolBar,
  Pagination,
  InputField,
  Modal,
  LoadingModal,
  SuccessModal,
  TableNoResult
} from 'common-components'
import { Divider, Paper, InputAdornment, Dialog } from '@material-ui/core'
import {
  Container,
  menus,
  BtnCont,
  Switch,
  SaveButton,
  CancelBtn,
  constCreate
} from './contsVar'
import { Add } from '@material-ui/icons'


const Realms = () => {
  let realms = ["sadsdf"]
  return (
    <>
      {/* <SEO title="Manage Realms" /> */}

      <div style={{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        paddingBottom: 30
      }}>
        <HeaderLink menu={menus} title="Realms" />
        {realms.length !== 0 && (
          <HeaderButton
            // openFunction={() => setCreate({ ...create, open: true })}
            buttonText="New realm"
          />
        )}
      </div>
      <Paper style={{ height: 500, display: 'flex', alignItems: 'center', justifyContent: 'center' }} >
        <TableNoResult
          headerText="Realms"
          mainMessage="No realm have been created"
          subMessage="Would you like to creat one? Just hit the “New Realm” button."
          renderButton={
            // <SaveButton onClick={() => setCreate({ ...create, open: true })}>
            <SaveButton >

              <Add />
              New Realm
              </SaveButton>
          }
        />
      </Paper>
    </>
  );
};

export { Realms };
